import React, {useEffect, useState} from 'react'
import { BaseUrl } from '../BaseUrl'
import Avatar from '@material-ui/core/Avatar';

const UserDet = (props) => {
    const [user, setUser] = useState([])

    useEffect(() => {
        fetch(`${BaseUrl}get_user/${props.uid}`).then((res) => res.json()).then((data)=> setUser(data))
}, [props.uid])
    return (
        <>
        {console.log(user)}
        {typeof user === undefined ? <>
            <h1>No data</h1>
        </> : <>
        <div>
        {console.log(user.first_name)}
        <Avatar>{user.first_name[0]}</Avatar>        
        <h5>{user.first_name} {" "} {user.last_name}</h5>

        </div>
        </>}
        </>
    )
}
// https://gomakethings.com/how-to-use-the-fetch-method-to-make-multiple-api-calls-with-vanilla-javascript/

export default UserDet
